import Aside from "../aside";
export default function Container(veiculos) {
    console.log(veiculos)
  return (
    <>
      <Aside>
        {veiculos.map((veiculo) => (
          <label marca={veiculo.marca} />
        ))}
      </Aside>
    </>
  );
}
